def plot_cost_latency_ratio():
    y=3
    x,t=math.ceil(len(cost_dict_list.keys())/y),0
    plt.figure(figsize=(10, 6))
    for algo in cost_dict_list.keys():
        cost_list=cost_dict_list[algo]
        if cost_list:
            t+=1
            plt.subplot(int(f'{x}{y}{t}'))
            x_data , y_data=list(),list()
            for time_point in cost_list.keys():
                x_data.append(time_point)
                y_data.append(cost_list[time_point][0]/cost_list[time_point][1])
            y_data=(np.array(y_data)*1000).tolist()
            plt.plot(x_data,y_data)
            plt.xlabel(algo)
            plt.ylabel("Latency/DiskCost")
    plt.subplots_adjust(wspace=0.5,hspace=0.6)
    # plt.show()
    plt.savefig("ratio1.svg")

plot_cost_latency_ratio()